import Header from './components/Header/Header';
import Video from './components/Video/Video';
import VideoDesc from './components/VideoDesc/VideoDesc';


function App() {
  return (
    <div className="App">
      <Header />
      <Video />
      <main>
        <VideoDesc />
      </main>
    </div>
  );
}

export default App;
